DELIMITER ;;
CREATE DEFINER=`root`@`localhost` PROCEDURE `Llenar_dimension_tiempo`(IN `startdate` DATE, IN `stopdate` DATE)
BEGIN
    DECLARE currentdate DATE;
    SET currentdate = startdate;
    WHILE currentdate < stopdate DO
        INSERT INTO tiempo (fecha, anio, mes, dia, trimestre, semana, diaNombre, mesNombre)
        VALUES (        currentdate,
                        YEAR(currentdate),
                        MONTH(currentdate),
                        DAY(currentdate),
                        QUARTER(currentdate),
                        WEEKOFYEAR(currentdate),
                        DATE_FORMAT(currentdate,'%W'),
                        DATE_FORMAT(currentdate,'%M'));
        SET currentdate = ADDDATE(currentdate,INTERVAL 1 DAY);
    END WHILE;
END ;;
DELIMITER ;
