CREATE DEFINER=`root`@`localhost` PROCEDURE `updateFecha`()
BEGIN 
	
    DECLARE var_cod INT;
    DECLARE var_date DATE;
    
    DECLARE var_final INT DEFAULT 0;

	DECLARE CURSOR_KEYS CURSOR FOR
		SELECT idSiniestro, fecha
		FROM siniestro
        ORDER BY 1;
	
    DECLARE CONTINUE HANDLER FOR NOT FOUND SET var_final = 1;
    OPEN CURSOR_KEYS;
    bucle: LOOP   
		FETCH CURSOR_KEYS INTO var_cod, var_date;
        
        IF var_final = 1 THEN
			LEAVE bucle;
		END IF;

        	UPDATE victima
			SET  fecha=var_date
			WHERE idSiniestro=var_cod;
	
	END LOOP bucle;
    CLOSE CURSOR_KEYS;
END ;;
