CREATE DEFINER=`root`@`localhost` PROCEDURE `updateNumberVictim`()
BEGIN 
	DECLARE var_nro INT;
    DECLARE var_cod INT;
    DECLARE var_count INT;
    
    DECLARE var_final INT DEFAULT 0;

	DECLARE CURSOR_KEYS CURSOR FOR
		SELECT idSiniestro, nroVictimas
		FROM siniestro
        ORDER BY 1;
	
    DECLARE CONTINUE HANDLER FOR NOT FOUND SET var_final = 1;
    OPEN CURSOR_KEYS;
    bucle: LOOP   
		FETCH CURSOR_KEYS INTO var_cod, var_nro;
        
        IF var_final = 1 THEN
			LEAVE bucle;
		END IF;
        
        SELECT COUNT(idSiniestro) INTO var_count FROM victima WHERE  idSiniestro= idSiniestro;

		IF var_count >=2 THEN
			UPDATE victima
			SET   nroVictimas= 1
			WHERE  idSiniestro = var_cod;
        
        ELSE
        	UPDATE victima
			SET   nroVictimas= var_nro
			WHERE  idSiniestro = var_cod;
            
		END IF;
	
	END LOOP bucle;
    CLOSE CURSOR_KEYS;
END ;;
